import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authAutentications";
import {Container, Row, Col, Button } from 'react-bootstrap';
import Logo from '../../immagini/logo.png'

class Dashboard extends Component {
  onLogoutClick = e => {
    e.preventDefault();
    this.props.logoutUser();
  };

  render() {
    const { user } = this.props.auth;

    return (
      <div>
       <Container style={{marginTop: '2rem', marginBottom: '20rem', textAlign: 'center'}}>
         <img src={Logo} width="3rem" color='black'/>
        <Row>
          <Col sm={12}>
            <h1>Benvenuto <b>{user.name}</b>, qui puoi gestire l'amministrazione!</h1>
          </Col>
        </Row>
        <Row>
          <Col sm={12}>
          <Button variant="primary" size="lg" block href="/">Gestione Corsa</Button>
          </Col>
        </Row>
        <Row>
          <Col sm={12}>
          <Button variant="primary" size="lg" block href="/">Gestione Amministrazione</Button>
          </Col>
        </Row>
        <Row>
        
        </Row>
        <button
              style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "1rem"
              }}
              onClick={this.onLogoutClick}
              className="btn btn-large waves-effect waves-light hoverable blue accent-3"
            >
              Logout
            </button>
        </Container>
      </div>
    );
  }
}

Dashboard.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(
  mapStateToProps,
  { logoutUser }
)(Dashboard);
